import Fruit from "./Fruit";

const array = ["Apple", "Banana", "Orange"];

function App() {
  return (
    <>
      <h1>Fruit List</h1>
      <ul>
        {array.map((frt, ind) => (
          <Fruit key={ind} name={frt} />
        ))}
      </ul>
    </>
  );
}

export default App;
